[{"name": "mcp__togomcp__run_sparql", "input": {"dbname": "uniprot", "sparql_query": "
PREFIX up: <http://purl.uniprot.org/core/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT DISTINCT ?protein ?proteinLabel ?function
WHERE {
  ?protein a up:Protein ;
           up:annotation ?annotation ;
           up:recommendedName ?name .

  ?annotation a up:Function_Annotation ;
              rdfs:comment ?function .

  ?name up:fullName ?fullName .

  FILTER(CONTAINS(LCASE(?function), "membrane receptor"))

  BIND(STR(?fullName) AS ?proteinLabel)
}
LIMIT 50
"}}]

[{"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "rhea"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "rhea", "sparql_query": "PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX rhea: <http://rdf.rhea-db.org/>

SELECT (COUNT(DISTINCT ?ec) as ?distinctEC)
WHERE {
  ?reaction rdfs:subClassOf rhea:Reaction ;
            rhea:status rhea:Approved ;
            rhea:ec ?ec .
}
"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "rhea", "sparql_query": "PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX rhea: <http://rdf.rhea-db.org/>

SELECT (COUNT(DISTINCT ?reaction) as ?reactionsWithEC)
WHERE {
  ?reaction rdfs:subClassOf rhea:Reaction ;
            rhea:status rhea:Approved ;
            rhea:ec ?ec .
}
"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "rhea", "sparql_query": "PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX rhea: <http://rdf.rhea-db.org/>

SELECT (COUNT(DISTINCT ?reaction) as ?totalApprovedReactions)
WHERE {
  ?reaction rdfs:subClassOf rhea:Reaction ;
            rhea:status rhea:Approved .
}
"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "rhea", "sparql_query": "PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX rhea: <http://rdf.rhea-db.org/>

SELECT ?ecClass (COUNT(DISTINCT ?ec) as ?distinctEC) (COUNT(DISTINCT ?reaction) as ?reactionCount)
WHERE {
  ?reaction rdfs:subClassOf rhea:Reaction ;
            rhea:status rhea:Approved ;
            rhea:ec ?ec .
  BIND(REPLACE(STR(?ec), "http://purl.uniprot.org/enzyme/(\\d+)\\..*", "$1") AS ?ecClass)
}
GROUP BY ?ecClass
ORDER BY ?ecClass
"}}]

[{"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "chembl"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "chembl", "sparql_query": "PREFIX cco: <http://rdf.ebi.ac.uk/terms/chembl#>

SELECT DISTINCT ?mechanismActionType (COUNT(?mechanism) as ?count)
FROM <http://rdf.ebi.ac.uk/dataset/chembl>
WHERE {
  ?mechanism a cco:Mechanism ;
             cco:mechanismActionType ?mechanismActionType .
}
GROUP BY ?mechanismActionType
ORDER BY DESC(?count)"}}]
